SRO. (ОКУД 0420850 Раздел 1 Подраздел 1.3) По показателю «Количество обращений за выплатой из компенсационного фонда в отчетном периоде» (sro-dic:KolObraschZaVyplIzKompensFonda) указывается количество обращений за выплатой из компенсационного фонда, поступивших в отчетном периоде от:
физических лиц, не являющихся индивидуальными предпринимателями, для возмещения реального ущерба, возникшего в результате несостоятельности (банкротства) членов саморегулируемой организации форекс-дилеров;
членов саморегулируемой организации, объединяющих кредитные потребительские кооперативы, при недостаточности собственного имущества члена саморегулируемой организации, объединяющей кредитные потребительские кооперативы, для выполнения его обязательств перед членами (пайщиками).
